import React from "react";

const ComA = () =>{
    return (
        <>
        <select>
            <option value="1">1</option>
            <option value="25">2</option>
            <option value="2">3</option>
            <option value="3">4</option>
            <option value="6">5</option>
        </select>
        </>
    );

};
export default ComA;
